import React from "react";
import record from "./db.json";
const Home = () => {
  console.log(record);
  return (
    <>
      <div
        style={{
          border: "2px solid black",
          width: "50%",
          height: "50vh",
          margin: "auto",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "space-around",
            border: "1px solid black",
          }}
        >
          <h4>Time</h4>
          {record.map((value) => {
            return <p>{value.name}</p>;
          })}
        </div>
        {record.map((val, index) => {
          return <p>{val.data[index].time} </p>;
        })}
      </div>
      <div style={{ position: "relative", left: "37%",bottom:"435px" }}> {  
         record.map((val,index) => { 

          if(val.name==="Air Temperature")
          {
            return val.data.map((temp)=>
            {
              return <p>{temp.value}</p>
            })
          }
        })}
      </div>
      {/* Relative Humidity */}
      <div style={{ position: "relative", left:"50%",bottom:"600px" }}> {  
         record.map((val,index) => { 

          if(val.name==="Relative Humidity")
          {
            return val.data.map((temp)=>
            {
              return <p>{temp.value}</p>
            })
          }
        })}
      </div>
      {/* Wind Speed */}
      <div style={{ position: "relative", left:"6%",bottom:"600px" }}> {  
         record.map((val,index) => { 

          if(val.name==="Wind Speed")
          {
            return val.data.map((temp)=>
            {
              return <p>{temp.value}</p>
            })
          }
        })}
      </div>

    </>
  );
};

export default Home;
